import React from "react";
import "./LoginPage.css";
import {
  IonContent,
  IonHeader,
  IonPage,
  IonTitle,
  IonToolbar,
  IonRow,
  IonCol,
  IonList,
  IonItem,
  IonButton,
  IonGrid,
  IonImg,
} from "@ionic/react";

class JoinHomePage extends React.Component {
  render() {
    return (
      <IonPage className="ion_page">
        <IonContent className="ion_content"></IonContent>
      </IonPage>
    );
  }
}

export default JoinHomePage;
